import React, { Component } from 'react';

import Carousel from 'react-bootstrap/Carousel';

class Car extends Component {

  render() {
    return (
        <Carousel >
      <Carousel.Item>

        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>

    </Carousel>
    );
  }
};

export default Car;
